import ReactDOM from 'react-dom';
import App from './components/home/Home';
ReactDOM.render(<App />, document.getElementById('root'));
import { BrowserRouter } from "react-router-dom";
ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
